import React from 'react';
import '../App.css';
import { NavLink } from 'react-router-dom';

function Homepage() {
  return (
    <div>This is Homepage.
      <nav className="role-nav">
        <NavLink exact to='/tutors'>Show me the tutors.</NavLink>
        <NavLink exact to='/students'>Show me the students.</NavLink>
      </nav>

    </div>
  );
}

export default Homepage;
